import React, { Component } from "react";
import "./Footer.css";

import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faFacebookMessenger,
  faFacebookF,
  faInstagram
} from "@fortawesome/free-brands-svg-icons";
import { faEnvelope } from "@fortawesome/free-solid-svg-icons";
import { Link, IconButton } from "@material-ui/core";

class Footer extends Component {
  render() {
    return (
      <div className="footer-container">
        <div>
          <span
            style={{
              color: "black",
              fontSize: 17,
              fontWeight: "bold"
            }}
          >
            Find us on:
          </span>
          <br />
          <IconButton>
            <Link href="https://www.facebook.com/rogervnn/">
              <FontAwesomeIcon
                icon={faFacebookF}
                color={"blue"}
                style={{ width: 30, height: 30 }}
              />
            </Link>
          </IconButton>
          <IconButton>
            <Link href="https://m.me/rogervnn?fbclid=IwAR0Ozfd8hPuSbteKHsg-V31eD52mjeL9QdVn8QjQTUo_t1j-JB0Ij-JCyMw">
              <FontAwesomeIcon
                icon={faFacebookMessenger}
                style={{ width: 30, height: 30, color: "#4fc3f7" }}
              />
            </Link>
          </IconButton>
          <IconButton>
            <Link href="https://www.facebook.com/rogervnn/">
              <FontAwesomeIcon
                icon={faInstagram}
                style={{ width: 30, height: 30, color: "#7e57c2" }}
              />
            </Link>
          </IconButton>
          <IconButton>
            <Link href="mailto:rogershoesvn@gmail.com">
              <FontAwesomeIcon
                icon={faEnvelope}
                style={{ width: 30, height: 30, color: "#ef5350" }}
              />
            </Link>
          </IconButton>
        </div>
        <div>
          <span className="title-footer">
            © 2009–2019 Zappos LLC or its affiliates, 400 East Stewart Avenue.
            Las Vegas NV 89101
          </span>
          <br />
          <span className="title-footer">
            6pm.com is operated by Zappos IP LLC. Products on 6pm.com are sold
            by 6pm.com, LLC.
          </span>
          <br />
          <span className="title-footer">
            <b></b> 52 Út Tịch, phường 4, quận Tân Bình, thành phố Hồ
            Chí Minh Tiki nhận đặt hàng trực tuyến và giao hàng tận nơi, chưa hỗ
            trợ mua và nhận hàng trực tiếp tại văn phòng hoặc trung tâm xử lý
            đơn hàng
          </span>
          <br />
          <span className="title-footer">
            © 2016 - Bản quyền của Công Ty Cổ Phần Ti Ki - Tiki.vn
          </span>
          <br />
          <span className="title-footer">
            Giấy chứng nhận Đăng ký Kinh doanh số 0309532909 do Sở Kế hoạch và
            Đầu tư Thành phố Hồ Chí Minh cấp ngày 06/01/2010
          </span>
          <br />
        </div>
      </div>
    );
  }
}

export default Footer;
